import styled from 'styled-components';

export const CartIconComponent = styled.div`
  width: 45px;
  height: 45px;
  position: relative;
  display: flex;
  align-items: center;
  justify-content: center;
  cursor: pointer;
`;

export const ShoppingIconComponent = styled.div`
  width: 24px;
  height: 24px;
`;

export const ItemCountComponent = styled.div`
  position: absolute;
  font-size: 10px;
  font-weight: bold;
  bottom: 12px;
`;
